import React from "react";
import start0 from "./images/start0.png";

export default function HangmanLogic() {
  return (
    <div className="w-full flex p-4 h-3/4">
      <img
        src={start0}
        className="shadow rounded max-w-full h-auto align-middle border-none"
        alt="hangmangame"
      />
      <div className="relative">Neki tekst koji treba pogoditi</div>
    </div>
  );
}
